import { AllService } from "./all.service";
import { columns } from "./all.config.ts";
import tableMixin from '@/mixins/table.mixin';
import CardBrandDepositRecoverSale from '@/views/biz-modals/card/brand-deposit/recover-sale';
import CardBrandDepositShopTable from '@/views/biz-modals/card/brand-deposit/shop-table';
import CardBrandDepositStopSale from '@/views/biz-modals/card/brand-deposit/stop-sale';
import { SUPPORT_SALES, CONSUMPTION_RANGE, SELL_STATUS } from '@/constants/card/deposit';
export default {
  mixins: [tableMixin],
  name: 'PageBrandProductDepositAll',
  bem: {
    all: 'page-brand-product-deposit-list-all'
  },
  serviceInject: function serviceInject() {
    return {
      allService: AllService
    };
  },
  modals: {
    CardBrandDepositRecoverSale: CardBrandDepositRecoverSale,
    CardBrandDepositShopTable: CardBrandDepositShopTable,
    CardBrandDepositStopSale: CardBrandDepositStopSale
  },
  rxState: function rxState() {
    return {
      sellStatus: this.allService.sellStatus$,
      loading: this.allService.loading$,
      publishChannel: this.allService.publishChannel$,
      list: this.allService.list$,
      page: this.allService.page$,
      auth: this.allService.auth$
    };
  },
  data: function data() {
    return {
      SUPPORT_SALES: SUPPORT_SALES,
      CONSUMPTION_RANGE: CONSUMPTION_RANGE,
      SELL_STATUS: SELL_STATUS
    };
  },
  computed: {
    columns: columns
  },
  methods: {
    // 编辑
    onEdit: function onEdit(record) {
      this.$router.push({
        path: "/brand/product/card/deposit/edit",
        query: {
          id: record.id
        }
      });
    },
    // 上架
    onShelf: function onShelf(record) {
      var _this = this;

      this.$confirm({
        title: '上架',
        content: "\u786E\u8BA4\u4E0A\u67B6".concat(record.card_name, "\u50A8\u503C\u5361\u81F3").concat(record.wait_shelf_num, "\u5BB6\u95E8\u5E97\uFF1F"),
        onOk: function onOk() {
          return _this.allService.setShelf(record.id).toPromise().then(function () {
            _this.$router.reload();
          });
        }
      });
    },
    // 停售
    onStopSale: function onStopSale(record) {
      var _this2 = this;

      this.$modalRouter.push({
        name: 'card-brand-deposit-stop-sale',
        props: {
          id: +record.id,
          cardName: record.card_name
        },
        on: {
          success: function success() {
            _this2.$router.push({
              query: _this2.$searchQuery
            });
          }
        }
      });
    },
    // 恢复售卖
    onRecoverSale: function onRecoverSale(record) {
      var _this3 = this;

      this.$modalRouter.push({
        name: 'card-brand-deposit-recover-sale',
        props: {
          id: record.id,
          cardName: record.card_name
        },
        on: {
          success: function success() {
            _this3.$router.push({
              query: _this3.$searchQuery
            });
          }
        }
      });
    },
    // 删除
    onDelete: function onDelete(record) {
      var _this4 = this;

      this.$confirm({
        title: '确认要删除',
        content: "\u786E\u8BA4\u5220\u9664".concat(record.card_name).concat(this.$c('member_card'), "\uFF1F"),
        onOk: function onOk() {
          return _this4.allService.deleteCard(record.id).toPromise().then(function () {
            _this4.$router.reload();
          });
        }
      });
    }
  }
};
